import { useState } from "react"

const TodosFilter = (props) => {

    const stile = stileTodosFilter

    const [stateBtn, changeBtn ]= useState(true)


return(
<>

<div className="container d-flex justify-content-center flex-wrap">
<div className="p-2 bg-transparent">
<div disabled={props.statoCountry === '' ? true : false} onClick={() => changeBtn(!stateBtn)}
className={`p-2 d-flex align-items-center h-100 rounded shadow ${stile.hoverBtn}`}>
